import { React } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect
} from "react-router-dom";
import Login from './component/Login'
import Application from './component/Application'
import './App.css';
import { createTheme,ThemeProvider } from '@material-ui/core/styles';


const otheme = createTheme({
  palette: {
    primary: {
      //light: '#757ce8',
      light: '#b2ebf2',
      main: '#0097a7',
      dark: '#002884',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ff7961',
      main: '#f44336',
      dark: '#ba000d',
      contrastText: '#000',
    },
  },
});


function App() {
  return (

    <div className="App">
        <ThemeProvider theme={otheme}>
      <Router>
        <div>
          <Switch>
            <Route exact path="/">
              <Redirect to="/login" />
            </Route>
            <Route  path="/application">
              <Application />
            </Route>

            <Route  path="/login">
              <Login />
            </Route>

          </Switch>
        </div>
      </Router>
      </ThemeProvider>
    </div>
  );
}

export default App;
